import Link from 'next/link';
import styled from 'styled-components';

const Logo = styled.h1`
  background: red;
`;

const Nav = () => (
  <nav>
    <Link href="/">
        <Logo>YouTime</Logo>
      </Link>
    <Link href="/products">Products</Link>
    <Link href="/sell">Sell</Link>
    <Link href="/orders">Orders</Link>
    <Link href="/account">Account</Link>
  </nav>
);

export default Nav;
